import React from "react";
import { Dialog, DialogTitle, DialogContent } from "@mui/material"

const SignInPopUp = (prop) => {
    const { title, children, openpopup, setopenpopup } = prop
    return (
        <Dialog open={openpopup}>
            <DialogTitle>
                <div>
                    Sign In here.
                </div>
            </DialogTitle>
            <DialogContent>
                {children}
            </DialogContent>

        </Dialog>
    )


}
export default SignInPopUp
